import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import CameraIcon from '@mui/icons-material/PhotoCamera';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { green } from '@mui/material/colors';
import vipLogo from './assets/vip_logo.png'
import axios from 'axios';

export const baseURL = "localhost:5000/";

const theme = createTheme({
  palette: {
    primary: {
      // light: will be calculated from palette.primary.main,
      main: '#c5f0e6',
      // dark: will be calculated from palette.primary.main,
      // contrastText: will be calculated to contrast with palette.primary.main
    },
    secondary: green
  },
  typography: {
    fontSize: 14,
    fontFamily: [
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(','),
  },
  spacing: 4
});

export default class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      imageLoaded: false,
      currentPage: 0
    };
    // this binding to event handlers
    this.aifsrRedirect = this.aifsrRedirect.bind(this);
  }

  aifsrRedirect(){
    axios.get(`https://localhost:5000/aifsrRedirect`);
  }

  render(){
    return(
      <ThemeProvider theme={theme}>
      <AppBar position="static">
        <Toolbar>
          <img src={vipLogo} alt="Logo" width={70} height={70} />
          <Typography variant="h6" color="inherit" sx={{ margin: 4,  flexGrow: 1 }} noWrap>
            NYU AIfSR Microscopy Team - Online Demo
          </Typography>
          <Button color="inherit" onClick={this.aifsrRedirect}>About NYU AIfSR</Button>
        </Toolbar>
      </AppBar>

     </ThemeProvider>

    );
  }
}
